    <style>
        /* 全屏黑色背景與置中設定 */
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body, html {
            width: 100%;
            height: 100%;
            background-color: #000000;
            display: flex;
            justify-content: center;
            align-items: center;
            overflow: hidden; /* 防止手機瀏覽器出現捲軸 */
            touch-action: none; /* 防止意外縮放 */
        }

        /* 圖片容器與動畫 */
        .image-container {
            width: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .bouncing-img {
            max-width: 80%;
            max-height: 80vh;
            object-fit: contain;
            /* 設置動畫：名稱 bounce，時間 1.5秒，平滑曲線，無限循環 */
            animation: bounce 1.5s ease-in-out infinite;
            -webkit-animation: bounce 1.5s ease-in-out infinite;
        }

        /* 定義縮放動畫 (彈下彈下效果) */
        @keyframes bounce {
            0% {
                transform: scale(0.9);
            }
            50% {
                transform: scale(1.15); /* 放大約 15% */
            }
            100% {
                transform: scale(0.9);
            }
        }

        @-webkit-keyframes bounce {
            0% {
                -webkit-transform: scale(0.9);
            }
            50% {
                -webkit-transform: scale(1.15);
            }
            100% {
                -webkit-transform: scale(0.9);
            }
        }
    </style>
</head>
